appraisal.p:
Dit archief is geselecteerd op de volgende Basis Selectie Documenten (BSD): 


BSD 015, Beleidsterrein Beheer van de Rijksbegroting, 1945-2000, Staatscourant 31 maart 2005 (nr. 62); 

BSD 142	Bestuurlijke en Financiële organisatie lagere overheden, 2007 Staatscourant 30 januari 2007 (nr. 21);

BSD 143 Organisatie Rijksoverheid, 1945-1999 Staatscourant 16 december 2005 (nr. 245)

Stukken van voor 1945 zijn niet aan een handeling gekoppeld en zijn volgens afspraak integraal bewaard gebleven. Er zijn stukken van na 1945 die eigenlijk voor vernietiging in aanmerking komen, maar die bewaard zijn gebleven op grond van artikel 5 lid e van het Archiefbesluit 1995. Bij dit archiefblok zijn de cultuurhistorische gronden: oorlogsrelatie, de wederopbouw en andere uitzonderingsgevallen zoals gijzelingen. De overige stukken werden vernietigd aan de hand van passende handelingen. Hiervan zijn vernietigingslijsten opgesteld en aan het ministerie verstuurd.

odd.p:
Openbare archiefstukken kunnen online worden aangevraagd en gereserveerd. U kunt dit ook via de terminals in de studiezaal van het Nationaal Archief doen. Om te kunnen reserveren dient u de volgende stappen te volgen: 

U maakt een profiel aan op www.gahetna.nl, en logt vervolgens in;

Via de archiefinventaris (alleen de beschrijvingen met rode nummers) selecteert u het gewenste archiefstuk door op de knop 'Reserveren' te klikken;

In het volgende scherm geeft u aan op welke dag u het archiefstuk wilt inzien;

Indien u zich bevindt in de studiezaal en een tafelnummer heeft ontvangen kunt u dit nummer vermelden. Als u geen tafelnummer heeft kunt u tafelnummer 777 laten staan;

Vervolgens bevestigt u uw reservering door deze te versturen.
